  [],\n\t\"revision_timestamp\": \"2015-05-07T00:49:33.804465\",\n\t\"name\": \"in-flight-and-pre-flight-detection-of-pitot-tube-anomalies-project-f1838\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The health and integrity of aircraft sensors
  play a critical role in aviation safety.  Unfortunately, inaccurate or false readings
  from these sensors can lead to improper decision-making resulting in serious and
  sometimes fatal consequences. The research performed in Phase I demonstrated the
  feasibility of using advanced data analysis techniques to identify anomalies in
  Pitot tubes resulting from blockage such as icing, moisture, or foreign objects.
  \ The core technology used in this project is referred to as \"noise analysis\"
  since it relates a sensor's response time to the dynamic component (noise) found
  in the signal of these same sensors.   This analysis technique has used existing
  electrical signals of Pitot tube sensors that result from measured processes during
  in-flight conditions and/or induced signals in pre-flight conditions to detect anomalies
  in the sensor readings.rnrnAMS has routinely used this technology to determine the
  health of pressure transmitters in nuclear power plants. The application of this
  technology for the detection of aircraft anomalies is innovative in that instead
  of determining the health of process monitoring at a steady state condition, this
  technology will be used to quickly inform the pilot when an air speed indication
  becomes faulty under any flight condition as well as during pre-flight preparation.
